import React from 'react';

const HalfDayCell = ({ day, city, startHour, endHour, method }) => {
  return (
    <tr>
      <th>{day}</th>
      <td><strong className="market-place">{city}</strong> <br/> {startHour} Ã  {endHour}</td>
      <td className="delivery">{method}</td>
    </tr>
  );
};

export default HalfDayCell;
